INSERT INTO `wp_posts` VALUES (8,1,'2020-12-30 23:16:48','2020-12-30 23:16:48','<div class=\"col-lg-4 ml-auto\">\r\n<p class=\"lead text-justify aos-init aos-animate\" data-aos=\"fade-right\">Soy Boris Travi, peruano, Ingeniero en Sistemas y fundador del Start-Up Travi&amp;Soft. Este proyecto nace gracias a las necesidades tecnolgicas que se requieren actualmente en el mercado, con nfasis en reinventar e innovar al tejido empresarial, agregando el mbito de sustentabilidad y mejoramiento del medio ambiente.</p>\r\n\r\n</div>\r\n<div class=\"col-lg-4 mr-auto\">\r\n<p class=\"lead text-justify aos-init aos-animate\" data-aos=\"fade-left\">Me inici como desarrollador de software en backend y tambin realizo proyectos web, plantillas en WordPress, desarrollo mvil y sistemas de punto de venta en desktop o web. Asimismo, brindamos asesoramiento de nuevas tecnologas de manera gratuita.</p>\r\n\r\n</div>','Sobre Nosotros','','publish','closed','closed','','nosotros','','','2021-04-06 01:32:19','2021-04-06 01:32:19','',0,'http://localhost:10004/?page_id=8',0,'page','',0);
