INSERT INTO `wp_posts` VALUES (58,1,'2021-01-25 23:22:28','2021-01-25 23:22:28','<h2>Beneficios para las empresas de tener una tienda online</h2>\r\n<ul>\r\n 	<li><strong>Alcance global</strong>: el comercio electrnico permite eliminar fronteras geogrficas a bajo costo y rpidamente.</li>\r\n 	<li><strong>Reduccin de costes</strong>: la implementacin de una tienda electrnica es mucho menor que la implementacin de una tienda fsica.</li>\r\n 	<li><strong>El negocio est siempre disponible</strong>: las soluciones de comercio electrnico permiten disponibilidades 7 das a la semana, 24 horas al da a un coste bajo.</li>\r\n 	<li><strong>Personalizacin</strong>: la personalizacin del tratamiento de los clientes se logra de manera rpida y eficiente.</li>\r\n 	<li><strong>Mercado de nicho</strong>: las empresas pueden atender por medios digitales de manera eficiente y a bajo coste clientes con caractersticas muy especiales (mercados de nicho).</li>\r\n 	<li><strong>Innovacin</strong>: el comercio electrnico facilita el conocimiento del cliente y la innovacin en la organizacin.</li>\r\n 	<li><strong>Prueba de productos</strong>: se pueden probar nuevos productos a travs de campaas o encuestas, llegando un nmero muy amplio de potenciales clientes y a costes muy reducidos.</li>\r\n 	<li><strong>Bajos costes de comunicacin</strong>: las empresas utilizando Internet como canal de comunicacin logran bajar de manera significativa sus costes.</li>\r\n 	<li><strong>Eficiencia en las compras</strong>: se logran eficiencias importantes en los procesos de compras de las empresas cuando se utiliza Internet.</li>\r\n 	<li><strong>Conocimiento del cliente</strong>: se puede conocer mejor a los clientes lo que facilitar la satisfaccin de sus necesidades y expectativas.</li>\r\n 	<li><strong>Mejora el servicio al cliente</strong>: se mejora la calidad, la eficiencia y los costes del proceso de servicio al cliente.</li>\r\n 	<li><strong>Bajos inventarios</strong>: el comercio electrnico le permite a las empresas minimizar los inventarios.</li>\r\n 	<li><strong>Distribucin de productos digitales</strong>: el coste de distribucin de productos digitales se reduce hasta en un 90%.</li>\r\n 	<li><strong>Reto a la cadena de intermediacin</strong>: algunas veces los productores pueden vender sus productos a los consumidores, sin utilizar la cadena de intermediacin.</li>\r\n 	<li><strong>Economa de red</strong>: Internet crece todos los das por lo que es ms valiosa cada da ya que una red es ms valiosa mientras ms integrantes tenga.</li>\r\n 	<li><strong>Aliados que facilitan la adopcin</strong>: las empresas que ingresen al comercio electrnico contarn con aliados para facilitar el proceso, desde el envo a la puerta de cliente, pasando porvirutas de papel,hasta lacaja para envo postales.</li>\r\n</ul>\r\n<!--more-->\r\n<h2>Beneficios para los consumidores del comercio electrnico</h2>\r\n<ul>\r\n 	<li><strong>Ubicuidad</strong>: el cliente puede estar localizado en cualquier parte con acceso a Internet y podr realizar la transaccin.</li>\r\n 	<li><strong>Ms productos y servicios</strong>: existe una gran variedad de productos y servicios disponibles en Internet.</li>\r\n 	<li><strong>Productos personalizados</strong>: la personalizacin de productos o servicios es muy comn en los sitios de comercio electrnico.</li>\r\n 	<li><strong>Productos o servicios al mejor precio</strong>: el consumidor puede comparar precios de los productos o servicios para comprar el que ms le convenga.</li>\r\n 	<li><strong>Envo inmediato</strong>: los productos digitales son entregados de manera inmediata.</li>\r\n 	<li><strong>Informacin disponible</strong>: el cliente tiene mucha informacin a su disposicin de los productos y servicios que est interesado en comprar.</li>\r\n 	<li><strong>Compartir su experiencia</strong>: puede utilizar internet y las redes sociales para comunicar su experiencia de compra.</li>\r\n 	<li><strong>Artculos poco comerciales</strong>: puede encontrar artculos que por su baja rotacin no se venden en las tiendas fsicas.</li>\r\n 	<li><strong>Rastreo de los pedidos</strong>: los consumidores tienen la posibilidad de hacer seguimiento a sus pedidos a travs de medios digitales.</li>\r\n</ul>\r\n. <a class=\"boton boton-primario boton-enlace\" href=\"https://pe.wordpress.org/themes/browse/new/\" target=\"_blank\" rel=\"noopener\">VER EJEMPLOS</a>','Tiendas virtuales (eComerce y Woocomerce)','','publish','closed','closed','','cardio-para-principiantes','','','2021-04-05 23:11:07','2021-04-05 23:11:07','',0,'http://localhost:10004/?post_type=gymfitness_clases&#038;p=58',0,'gymfitness_clases','',0);
