INSERT INTO `wp_posts` VALUES (89,1,'2021-02-02 16:18:09','2021-02-02 16:18:09','<label> Tu nombre\r\n    [text* your-name] </label>\r\n\r\n<label> Tu correo electrnico\r\n    [email* your-email] </label>\r\n\r\n<label> Tu telfono\r\n[tel telefono] \r\n</label>\r\n\r\n<label> Mensaje (optional)\r\n    [textarea your-message] </label>\r\n\r\n[submit Enviar]\n1\n[_site_title] -Contacto desde pgina web\n[_site_title] <dev-email@flywheel.local>\n[_site_admin_email]\nDe: [your-name] <[your-email]>\r\nAsunto: Contacto desde la pagina web\r\n\r\nCuerpo del mensaje:\r\nSu telfono es: [telefono]\r\nEmail: [your-email]\r\n[your-message]\r\n\r\n\r\n-- \r\nEste mensaje se ha enviado desde un formulario de contacto en [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <dev-email@flywheel.local>\n[your-email]\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n-- \r\nEste mensaje se ha enviado desde un formulario de contacto en [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nGracias por tu mensaje. Ha sido enviado.\nHubo un error intentando enviar tu mensaje. Por favor intntalo de nuevo ms tarde.\nUno o ms campos tienen un error. Por favor revisa e intntalo de nuevo.\nHubo un error intentando enviar tu mensaje. Por favor intntalo de nuevo ms tarde.\nDebes aceptar los trminos y condiciones antes de enviar tu mensaje.\nEl campo es obligatorio.\nEl campo es demasiado largo.\nEl campo es demasiado corto.\nEl formato de fecha es incorrecto.\nLa fecha es anterior a la ms temprana permitida.\nLa fecha es posterior a la ms tarda permitida.\nHubo un error desconocido subiendo el archivo.\nNo tienes permisos para subir archivos de este tipo.\nEl archivo es demasiado grande.\nSe ha producido un error subiendo la imagen\nEl formato de nmero no es vlido.\nEl nmero es menor que el mnimo permitido.\nEl nmero es mayor que el mximo permitido.\nLa respuesta al cuestionario no es correcta.\nLa direccin de correo electrnico que has introducido no es vlida.\nLa URL no es vlida.\nEl nmero de telfono no es vlido.','Formulario de contacto 1','','publish','closed','closed','','formulario-de-contacto-1','','','2021-02-02 17:53:31','2021-02-02 17:53:31','',0,'http://localhost:10004/?post_type=wpcf7_contact_form&#038;p=89',0,'wpcf7_contact_form','',0);
