INSERT INTO `wp_posts` VALUES (194,1,'2021-04-06 00:49:46','2021-04-06 00:49:46','<div class=\"col-lg-4 ml-auto\">\r\n<p class=\"lead text-justify aos-init aos-animate\" data-aos=\"fade-right\">Soy Boris Travi, peruano, Ingeniero en Sistemas y fundador del Start-Up Travi&amp;Soft. Este proyecto nace gracias a las necesidades tecnolgicas que se requieren actualmente en el mercado, con nfasis en reinventar e innovar al tejido empresarial, agregando el mbito de sustentabilidad y mejoramiento del medio ambiente.\r\n\r\n\r\n\r\n\r\n\r\n</p>\r\n\r\n</div>\r\n<div class=\"col-lg-4 mr-auto\">\r\n<p class=\"lead text-justify aos-init aos-animate\" data-aos=\"fade-left\">Me inici como desarrollador de software en backend y tambin realizo proyectos web, plantillas en WordPress, desarrollo mvil y sistemas de punto de venta en desktop o web. Asimismo, brindamos asesoramiento de nuevas tecnologas de manera gratuita.</p>\r\n\r\n</div>','Sobre Nosotros','','inherit','closed','closed','','8-revision-v1','','','2021-04-06 00:49:46','2021-04-06 00:49:46','',8,'http://localhost:10004/?p=194',0,'revision','',0);
